import React from 'react';

export default class About extends React.Component {
  render() {
    return (
      <div class="main_about">
				<div class="about_about">
					<h1>About Us</h1>
					<p>Divide have don't man wherein air fourth. Own itself make have night won't make.
	A you under Seed appear which good give. Own give air without fowl moveth dry first
	heaven fruit, dominion she'd won't very all.
	</p>
					<img src="signature.png" />
				</div>
        <Skills info={bar}/>
				<Work />
			</div>
    );
  }
}

class Skills extends React.Component {
  render() {
    return(
      <div class="about_skills">
        <div class="about_left">
          <h1>Professional Skills</h1>
          <ul>
            {this.props.info.map((item, index) => (
              <Progress id={index} bar={item.name} percent={item.percent} />
            ))}
          </ul>
        </div>
        <div class="about_right"></div>
      </div>
    );
  }
}

class Progress extends React.Component {
  render() {
    const width = {
      width : `${this.props.percent}%`
    }
    return(
      <>
        <li>{this.props.bar}</li>
        <div className="bar">
          <div style={width}></div>
        </div>
      </>
    )
  }
}

const bar = [
  {name:'UI/UX DESIGN',
  percent: 75},
  {name:'WEB DEVELOPMENT',
  percent: 90},
  {name:'MARKETING',
  percent: 65}
]

class Work extends React.Component {
  render() {
    return(
      <div class="about_work">
        <div class="work_block">
          <span class="pe-7s-portfolio">
            <div class="work_numbers">
              <div class="numb">548</div>
              <div class="work_name">PROJECTS COMPLETED</div>
            </div>
          </span>
          <span class="pe-7s-clock">
            <div class="work_numbers">
              <div class="numb">1465</div>
              <div class="work_name">WORKING HOURS</div>
            </div>
          </span>
          <span class="pe-7s-star">
            <div class="work_numbers">
              <div class="numb">612</div>
              <div class="work_name">POSITIVE FEEDBACKS</div>
            </div>
          </span>
          <span class="pe-7s-like">
            <div class="work_numbers">
              <div class="numb">735</div>
              <div class="work_name">HAPPY CLIENTS</div>
            </div>
          </span>
        </div>
      </div>
    );
  }
}

const pict = [
  {class:portfolio,
  numb:548,
  name:'PROJECTS COMPLETED'},
  {class:clock,
  numb:1465,
  name:'WORKING HOURS'},
  {class:star,
  numb:612,
  name:'POSITIVE FEEDBACKS'},
  {class:like,
  numb:735,
  name:'HAPPY CLIENTS'},
]
